import React from 'react';
import {Button, Container, Nav, Navbar} from "react-bootstrap";
import {NavLink, useNavigate} from "react-router-dom";
import {MAIN_ROUTE, ORDER_ROUTE, ORDERPAGE_ROUTE} from "../utils";
import {observer} from "mobx-react-lite";


const MyNavBar = observer(() => {
    const navigate = useNavigate
    return (
        <Navbar bg="dark" variant="dark">
            <Container>
                <Nav className="ml-auto" style={{color:"white", height:50}} >
                    <div className="d-flex align-items-center">
                        <NavLink style={{color:"white", marginLeft:30}} to={MAIN_ROUTE}>Бокси</NavLink>
                        <NavLink style={{color:"white",marginLeft:30}} to={ORDER_ROUTE}> Замовлення</NavLink>
                    </div>

                </Nav>
            </Container>
        </Navbar>
    );
}) ;

export default MyNavBar;
